import React, { useEffect, useState } from "react";
import "./apiCss.css";

const ApiPage = () => {
  const [users, setUsers] = useState([]);

  const fetchUserData = () => {
    fetch("https://api.coincap.io/v2/assets")
      .then((response) => response.json())
      .then((data) => {
        setUsers(data.data); // Update here to set 'data.data' to the 'users' state
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  };

  useEffect(() => {
    fetchUserData();
  }, []);

  return (
    <div>
      {users.length > 0 && (
        <ul>
          {users.map((user) => (
            <li key={user.id}>{user.name}</li>
          ))}
          {users.length > 0 && (
            <ul>
              {users.map((user) => (
                <li key={user.id}>{user.priceUsd}</li>
              ))}
            </ul>
          )}
        </ul>
      )}
    </div>
  );
};

export default ApiPage;
